import querystring from 'querystring';
import axios from 'axios';
import debug from 'util/logger.jsx';


var sendToServer = function (url, namespace, model, action, properties, callback) {
    var portletUrl = url;

    // common params for serverResource attendance
    var param1 = namespace + "serve_resource_action";
    var param2 = namespace + "resource";
    var param3 = namespace + "properties";

    var objPayload = {};
    objPayload[param1] = action;
    objPayload[param2] = model;
    objPayload[param3] = JSON.stringify(properties);

    var payload = querystring.stringify(objPayload);


    if (portletUrl.includes("posttestserver")) {
        var randomNumberBetween0and19 = Math.floor(Math.random() * 20);
        debug("SIMULATE post call with random " + randomNumberBetween0and19 + " and properties " + JSON.stringify(properties));
        var res = null;
        if (action == "save") {
            res = FAKE_RESPONSE_ANIMAL_SAVE_OK;
            if (randomNumberBetween0and19 < 7) {
                res = FAKE_RESPONSE_ANIMAL_SAVE_ERROR;
            }
        } else if (action == "search") {
            if (randomNumberBetween0and19 < 3) {
                res = FAKE_RESPONSE_ANIMAL_SEARCH_ERROR;
            } else {
                res = FAKE_RESPONSE_ANIMAL_SEARCH_OK;
            }
        } else if (action == "getItem") {
            if (randomNumberBetween0and19 < 3) {
                res = FAKE_RESPONSE_ANIMAL_SEARCH_ERROR;
            } else {
                res = FAKE_RESPONSE_ANIMAL_SEARCH_1_OK;
            }
        } else if (action == "upload-file") {
            if (randomNumberBetween0and19 < 3) {
                res = FAKE_RESPONSE_UPLOAD_FILE_ERROR;
            } else {
                res = FAKE_RESPONSE_UPLOAD_FILE_OK;
            }
        } else {
            debug("Unknown action to portlet.jsx ["+action+"]");
        }
        if (callback) {
            callback(res);
        }
    } else {
        debug("Sending toserver [" + portletUrl + "]: " + payload);
        axios.post(portletUrl, payload).then(res=> {
            debug("Response: " + JSON.stringify(res));
            debug("Response Status: " + res.status);
            if (res.status == 200) {
            }
            if (callback) {
                callback(res);
            }
        });
    }
};
module.exports = sendToServer;


